import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li>
          <NavLink to="/" end>
            Home
          </NavLink>
        </li>
        <li>
          <NavLink to="/stock">
            Stock Tracker
          </NavLink>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
